function toInsert(decode, id) {
  let insert  = 'INSERT INTO points (latitude, longitude, route_id) VALUES ';
  decode.forEach((coords) => {
    insert += "(" +coords[0] +","+ coords[1] +","+id+"),";
  })
  insert = insert.slice(0, insert.length-1);
  insert = insert.concat(';');
  return insert;
}
